import React, {Component} from 'react';

class LabForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      lab: 'coconut',
    };

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {
    this.setState({lab: event.target.value});
  }

  handleSubmit(event) {
    //Nothing for now
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label>
          Pick a lab to view daily trends for:
          <select value={this.state.lab} onChange={this.handleChange, this.proprs.action}>
            <option value="DCL L416">DCL L416</option>
            <option value="ECEB 2022">ECEB 2022</option>
            <option value="EH 406B1">EH 406B1</option>
            <option value="SIEBL 0218">SIEBL 0218</option>
          </select>
          You chose: {this.state.lab}
        </label>
      </form>
    );
  }
}

export default LabForm;
